import "./groups.css"

const Groups = () => {
    return(
        <div>
            <div>
                <h3>Группы</h3>
                <div>
                    <button>Ваши Группы</button>
                </div>
                <div>
                    <button>Нати группу</button>
                </div>
                <div>
                    <button>Создать Группу</button>
                </div>
            </div>
        </div>
    )
};
export default Groups;
